*f2*h3*m2 + Ip222*f2*h3*m2 - Ip111*c3*f2*mv*cos(2*fi3) + Ip122*c3*f2*mv*cos(2*fi3) - Ip111*f2*g3*m1*cos(2*fi3) + Ip122*f2*g3*m1*cos(2*fi3) - Ip111*f2*h3*m2*cos(2*fi3) + Ip122*f2*h3*m2*cos(2*fi3) - Ip211*c3*f2*mv*cos(2*sy3) + Ip222*c3*f2*mv*cos(2*sy3) + Ip111*c3*f1*mv*sin(2*fi3) - Ip122*c3*f1*mv*sin(2*fi3) - Ip211*f2*g3*m1*cos(2*sy3) + Ip222*f2*g3*m1*cos(2*sy3) - Ip211*f2*h3*m2*cos(2*sy3) + Ip222*f2*h3*m2*cos(2*sy3) + Ip111*f1*g3*m1*sin(2*fi3) - Ip122*f1*g3*m1*sin(2*fi3) + Ip111*f1*h3*m2*sin(2*fi3) - Ip122*f1*h3*m2*sin(2*fi3) - 2*Ip133*c3^2*mv^2*p3*w2 - 2*Ip233*c3^2*mv^2*q3*w2 - 2*Ip133*g3^2*m1^2*p3*w2 - 2*Ip133*h3^2*m2^2*p3*w2 - 2*Ip233*g3^2*m1^2*q3*w2 - 2*Ip233*h3^2*m2^2*q3*w2 + Ip211*c3*f1*mv*sin(2*sy3) - Ip222*c3*f1*mv*sin(2*sy3) + 4*Icv22*c3^2*mv^2*w2*w3 - 2*Icv33*c3^2*mv^2*w2*w3 + 2*Ip111*c3^2*mv^2*w2*w3 + 2*Ip122*c3^2*mv^2*w2*w3 - 2*Ip133*c3^2*mv^2*w2*w3 + 2*Ip211*c3^2*mv^2*w2*w3 + 2*Ip222*c3^2*mv^2*w2*w3 - 2*Ip233*c3^2*mv^2*w2*w3 + Ip211*f1*g3*m1*sin(2*sy3) - Ip222*f1*g3*m1*sin(2*sy3) + 4*Icv22*g3^2*m1^2*w2*w3 - 2*Icv33*g3^2*m1^2*w2*w3 + 2*Ip111*g3^2*m1^2*w2*w3 + 2*Ip122*g3^2*m1^2*w2*w3 - 2*Ip133*g3^2*m1^2*w2*w3 + 2*Ip211*g3^2*m1^2*w2*w3 + 2*Ip222*g3^2*m1^2*w2*w3 - 2*Ip233*g3^2*m1^2*w2*w3 + Ip211*f1*h3*m2*sin(2*sy3) - Ip222*f1*h3*m2*sin(2*sy3) + 4*Icv22*h3^2*m2^2*w2*w3 - 2*Icv33*h3^2*m2^2*w2*w3 + 2*Ip111*h3^2*m2^2*w2*w3 + 2*Ip122*h3^2*m2^2*w2*w3 - 2*Ip133*h3^2*m2^2*w2*w3 + 2*Ip211*h3^2*m2^2*w2*w3 + 2*Ip222*h3^2*m2^2*w2*w3 - 2*Ip233*h3^2*m2^2*w2*w3 - 2*Icv22*Ip133*m1*p3*w2 - 2*Icv22*Ip133*m2*p3*w2 - 2*Ip111*Ip122*m1*p3*w2 - 2*Ip111*Ip122*m2*p3*w2 - Ip111*Ip133*m1*p3*w2 - Ip111*Ip133*m2*p3*w2 - Ip122*Ip133*m1*p3*w2 - Ip122*Ip133*m2*p3*w2 - Ip133*Ip211*m1*p3*w2 - Ip133*Ip211*m2*p3*w2 - Ip133*Ip222*m1*p3*w2 - Ip133*Ip222*m2*p3*w2 - 2*Icv22*Ip133*mv*p3*w2 - 2*Ip111*Ip122*mv*p3*w2 - Ip111*Ip133*mv*p3*w2 - Ip122*Ip133*mv*p3*w2 - Ip133*Ip211*mv*p3*w2 - Ip133*Ip222*mv*p3*w2 - 2*Icv22*Ip233*m1*q3*w2 - 2*Icv22*Ip233*m2*q3*w2 - Ip111*Ip233*m1*q3*w2 - Ip111*Ip233*m2*q3*w2